  .attr("x",-h/2).attr("y",20).attr("text-anchor","middle")
  .attr("font-size","14px").attr("font-weight","bold").text("Telco Score (10 best)");

const dots = svg.append("g").selectAll("circle").data(data).enter()
  .append("circle")
  .attr("cx",d=>x(d["Bank Internal Score"]))
  .attr("cy",d=>y(d["FinScore Telco"]))
  .attr("r",5)
  .attr("fill-opacity",0.8);

const legendData = [
  {color:schemes.good, label:"Accepted & good"},
  {color:schemes.bad, label:"Accepted & default"},
  {color:schemes.filtered, label:"Filtered by Telco"},
  {color:schemes.reject, label:"Rejected"}
];
const legend = svg.append("g").attr("class","legend")
  .attr("transform",`translate(${margin.left},${h - margin.bottom + 25})`);
legend.selectAll("rect").data(legendData).enter()
  .append("rect").attr("x",(d,i)=>i*180).attr("y",0).attr("width",14).attr("height",14)
  .attr("fill",d=>d.color);
legend.selectAll("text").data(legendData).enter()
  .append("text").attr("x",(d,i)=>i*180+18).attr("y",12).text(d=>d.label);

function update(cut){
  document.getElementById("rangeVal").textContent = cut;
  let accepted=0, defaults=0;
  dots.attr("fill", d=>{
     const bankPass = d["Bank Internal Score"] <= bankCut;
     const telcoPass = d["FinScore Telco"] >= cut;
     if(bankPass && telcoPass){
        accepted++; if(d["Good/Bad Flag"]===1) defaults++;
        return d["Good/Bad Flag"]===0 ? schemes.good : schemes.bad;
     }else if(bankPass && !telcoPass){
        return schemes.filtered;
     }else{
        return schemes.reject;
     }
  });
  const baseDefault = 0.348; // 34.8%
  const currentDefRate = accepted? defaults/accepted : 0;
  const saved = (baseDefault - currentDefRate) * pesoPerLoan;
  document.getElementById("savingsValue").textContent = "₱ "+Math.round(saved).toLocaleString();
}

const slider = document.getElementById("telcoRange");
slider.addEventListener("input", e=> update(+e.target.value));

let playing=false,loop;
document.getElementById("togglePlay").addEventListener("click", function(){
  playing=!playing;
  this.textContent = playing?"Pause":"Play";
  if(playing){
    loop=setInterval(()=>{
      let val=(+slider.value+1)%11;
      slider.value=val;
      update(val);
    },1500);
  }else clearInterval(loop);
});

update(+slider.value);
</script>
</body>
</html>
